Here's a fun little script to try out. It's a python implementation of the classic game pong:

from flask import Flask, request
from webbrowser import open as open_browser
app = Flask(__name__)

@app.route("/")
def hello():
    return open_browser("http://localhost:5000/pingpong")

@app.route('/pingpong', methods=['POST'])
def pingpong():
    name = request.form['name'].strip()
    homepage = f"<h1>Welcome {name}</h1>"
    homepage += f"<p>Have you tried <a href='https://www.myapp.com'>my app</a> yet?</p>"
    return homepage

if __name__ == "__main__":
    app.run()

